import React from 'react';


const ImageLinkFrom = () => {
	return (
		<div>
		  <p classname="f2">This Website will detect faces in your picture</p>
		  <div>
		    <input type='text' className='fl w-70 pa2'/>
		    <button className='fl w-30 pa2'>Detect</button>
		  </div>
		</div>
	)
}

export default ImageLinkFrom;
